import React, { Component } from 'react';
import { RowInput, Input } from '../../components';
import "./style.css"

class Daftar extends Component {
    constructor(props) {
        super(props);
        this.state = {
            name: "",
            username: "",
            password: "" 
        }
    }

    onChangeInput = e => {
        console.log(e.target)
        this.setState({
            [e.target.name]: e.target.value
        })
    }

    onDaftar = () => {
        const { username, password, name } = this.state
        console.log(username, " : ", password, name);
        this.setState({
            username: "user",
            password: "user123"
        })
    }

    render() {
        return (
            <div className="sectionLogin">
                <div>
                    <RowInput value={this.state.name} label="Password" type="text" name="name" onChange={this.onChangeInput} />
                    <RowInput value={this.state.username} label="Username" type="text" name="username" onChange={this.onChangeInput} />
                    <RowInput value={this.state.password} label="Password" type="password" name="password" onChange={this.onChangeInput} />
                    <div>
                        <Input typeInput="button" valueInput="Daftar" onClickInput={this.onDaftar} />
                    </div>
                </div>
            </div>
        );
    }
}

export default Daftar;
